import React from 'react';

function Logo() {
    return (
        <div>
            <svg id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 105 150"><defs><style>.cls-1{{fill:"#FFFFFF"}}</style></defs><title>E</title><polygon class="cls-1" points="105 0 105 150 95 150 95 105 0 105 0 95 95 95 95 55 0 55 0 45 95 45 95 0 105 0" /></svg>
        </div>
    );
}

export default Logo;
